const Welcome = () => {
  return (
    <div>
      <h1>여러분의 다이어트 성공을 기원합니다!</h1>
      <p>스타벅스 칼로리 계산기 앱에 오신 것을 환영합니다.</p>
    </div>
  );
};

export default Welcome;
